body:
Official public v1.0.0 on 2015-03-30.

The foundation of Bridge.NET is a C# to JavaScript source-to-source compiler, also known as a Cross Compiler or Transpiler. Using Bridge.NET you write your code in C# and Bridge.NET will magically transform into JavaScript.

#### Example

```
using System;
using Bridge;
using Bridge.Html5;

namespace Demo
{
    public class App
    {
        [Ready]
        public static void Main()
        {
            Window.Alert("Welcome to Bridge.NET");
        }
    }
}
```

